import React from 'react';
import './Template.css';

function Template() {
    return (
        <div className='container'>
            <div className='box-one'></div>
            <div className='box-two'></div>
            <div className='box-three'></div>
            <div className='box-four'></div>

        </div>
    )
}

export default Template;
